import { StyleSheet } from "@react-pdf/renderer"

import global from "./global"

export default StyleSheet.create({
  ...global,
  container: {
    display: "flex",
    fontSize: 13,
    width: "90%",
    padding: "2 0",
    margin: "0 auto",
    height: "auto",
    // backgroundColor: "white",
    borderTop: "3px solid #fff5f5",
  },
  email: {
    color: "#fff2e6",
    textDecoration: "none",
    lineHeight: 1.3,
    textTransform: "uppercase",
  },

  address: {
    display: "flex",
    flexDirection: "row",
    flexWrap: "wrap",
    paddingTop: 10,
    lineHeight: 1.3,
  },
})
